import { Link } from "react-router-dom";
import style from "./Landing.module.css"

const Landing = ()=>{
    return(
        <body className={style.body}>
        <h1>Esta es la vista del Landing</h1>
        <Link to='/home/1'>
        <button>Home</button>
        </Link>
        </body>
    )
}

export default Landing;
